// SPDX-License-Identifier: UNLICENSED

pragma solidity >0.7.0 <0.9.0;

contract Donation {

    string public _name;
    uint public _minAmount;
    uint public  _amountNeeded;
    bool _acceptPaymentAfterAmountMet;


    constructor(string memory name, uint minAmount, bool accept, uint amountNeeded) {
        _name = name;
        _minAmount = minAmount;
        _acceptPaymentAfterAmountMet = accept;
        _amountNeeded = amountNeeded;
    }


    function donate() payable external {
        require(msg.value >= _minAmount, "You cannot donate below ${_minAmount}");
    }
}

